import './style.css';
import { BrowserRouter } from "react-router-dom";

function telaInicial(){
      
    return(
        <BrowserRouter>
            <div className="fundo">
            <p>TESTE</p>
            <input type='text'></input>
            </div>
        </BrowserRouter>
    );
}

export default telaInicial;
